import React from "react";
import "../../../Styles/Pages/Cart/CartContainer.scss";
import ShoppingCartOutlinedIcon from "@material-ui/icons/ShoppingCartOutlined";
import DescriptionOutlinedIcon from "@material-ui/icons/DescriptionOutlined";
import CreditCardOutlinedIcon from "@material-ui/icons/CreditCardOutlined";
import CartProduct from "./CartProduct";
import { cartList } from "./cartList";
import CartOrder from "./CartOrder";

function CartConainer() {
  return (
    <div className='cartContainer'>
      <div className='cartContainer__description'>
        <div className='cartContainer__cart'>
          <ShoppingCartOutlinedIcon />
          <p>Your Cart</p>
        </div>
        <div className='cart__line'></div>
        <div className='cartContainer__details'>
          <DescriptionOutlinedIcon />
          <p>Billing Details</p>
        </div>
        <div className='cartGray__line'></div>
        <div className='cartContainer__payment'>
          <CreditCardOutlinedIcon />
          <p>Payment</p>
        </div>
      </div>
      <h1>Your Shopping Cart</h1>
      <div className='cartContainer__container'>
        <div className='productsContainer'>
          <div className='productDescription'>
            <p>Product</p>
            <p>Quantity</p>
            <p>Price</p>
          </div>
          <div className='productPlace'>
            {cartList.map((prod, key) => {
              return (
                <CartProduct
                  img={prod.img}
                  title={prod.title}
                  type={prod.type}
                  whoCan={prod.whoCan}
                  device1={prod.device1}
                  device2={prod.device2}
                  device3={prod.device3}
                  key={key}
                />
              );
            })}
          </div>
        </div>
        <div className='orderSummary'>
          <CartOrder />
        </div>
      </div>
    </div>
  );
}

export default CartConainer;
